werfull Ferrari\'s with the older niece of Daniel, a terrible driver who gets the legendary white taxi.','tt7238392',2018,'64d3387885f3826c68026f019a33569ea1d98c2f.jpg','2019-11-29 12:22:20'),(693,'Just Getting Started','A two-hander action comedy in the vein of Midnight Run (1988), about an ex-F.B.I. Agent (Tommy Lee Jones) and an ex-mob lawyer in the Witness Protection Program (Morgan Freeman) having to put aside their petty rivalry on the golf course to fend off a mob hit.','tt5721088',2017,'9bfd3921d36e27277d7ac1b2dda51d9279acca85.jpg','2019-11-29 12:22:20'),(694,'Lady Bird','In 2002, an artistically inclined seventeen-year-old girl comes of age in Sacramento, California.','tt4925292',2017,'0ecd4b0c0fd5b16d2b3ef0bfc24c5f07c6639446.jpg','2019-11-29 12:22:21'),(695,'Rescue Dawn','A U.S. fighter pilot\'s epic struggle of survival after being shot down on a mission over Laos during the Vietnam War.','tt0462504',2006,'89449cea47de50bf02a5598c225f715b65df99f7.jpg','2019-11-29 12:22:21'),(696,'Hostiles','In 1892, a legendary Army Captain reluctantly agrees to escort a Cheyenne chief and his family through dangerous territory.','tt5478478',2017,'d2dd8462daa81d453887660431f21a29bcd074bf.jpg','2019-11-29 12:22:22'),(697,'The Vanishing of Sidney Hall','Sidney Hall finds accidental success and unexpected love at an early age, then disappears without a trace.','tt1291566',2017,'nocover.jpg','2019-11-29 12:22:22'),(698,'The Post','A cover-up that spanned four U.S. Presidents pushed the country\'s first female newspaper publisher and a hard-driving editor to join an unprecedented battle between the press and the government.','tt6294822',2017,'09f337a172aa8783e7758dd1cd85b1dc484ba935.jpg','2019-11-29 12:22:22'),(699,'Breakable You','The film follows the Wellers, A dynamic New York City family as they come to terms with themselves and each other.','tt5101878',2017,'nocover.jpg','2019-11-29 12:22:23'),(700,'My Cousin Rachel','A young Englishman plots revenge against his late cousin\'s mysterious, beautiful wife, believing her responsible for his death. But his feelings become complicated as he finds himself falling under the beguiling spell of her charms.','tt4411596',2017,'nocover.jpg','2019-11-29 12:22:23'),(701,'Superswede: En film om Ronnie Peterson','The life of swedish racecar legend Ronnie Peterson.','tt6047030',2017,'43699bb24b156df72488218b63a3f863de215627.jpg','2019-11-29 12:22:24'),(702,'S.W.A.T.: Under Siege','A SWAT compound comes under fire from an international terrorist who relentlessly and violently pursues a mystery man who was apprehended by Seattle SWAT after a raid went horribly wrong.','tt6014472',2017,'5971015ad87a9b382c881d3aadb68cdff1b4fa57.jpg','2019-11-29 12:22:24'),(703,'Safe','Mei, a young girl whose memory holds a priceless numerical code, finds herself pursued by the Triads, the Russian mob, and corrupt NYC cops. Coming to her aid is an ex-cage fighter whose life was destroyed by the gangsters on Mei\'s trail.','tt1656190',2012,'10de9a7c724ba3e4f080e722078976e363eb85b0.jpg','2019-11-29 12:22:25'),(704,'I Am Wrath','A man is out for justice after a group of corrupt police officers are unable to catch his wife\'s killer.','tt3212232',2016,'13c8f44ff94aebe14b560141b4daeefc0ef66123.jpg','2019-11-29 12:22:25'),(705,'Kung Fu Panda 2','Po and his friends fight to stop a peacock villain from conquering China with a deadly new weapon, but first the Dragon Warrior must come to terms with his past.','tt1302011',2011,'ca397effabc3e739df8eaa10b729e2da6d2e92e6.jpg','2019-11-29 12:22:26'),(706,'Flubber','An absent-minded professor discovers &quot;flubber,&quot; a rubber-like super-bouncy substance.','tt0119137',1997,'c7facf7a60b21fc4e85db25ec99070a33c1e3c51.jpg','2019-11-29 12:22:26'),(707,'Sleeping with Other People','A good-natured womanizer and a serial cheater form a platonic relationship that helps reform them in ways, while a mutual attraction sets in.','tt3165612',2015,'nocover.jpg','2019-11-29 12:22:27'),(708,'Southpaw','A champion boxer fights to get his daughter back from child protective services as well as revive his professional career, after a fatal incident sends him on a rampant path of destruction.','tt1798684',2015,'3d8f85804bf53bbec6cfba5f40cc2d19dd03d3ab.jpg','2019-11-29 12:22:28'),(709,'TRON','A computer hacker is abducted into the digital world and forced to participate in gladiatorial games where his only chance of escape is with the help of a heroic security program.','tt0084827',1982,'fe563f68e97da89b8ceb7de1d341fd4fb50a8381.jpg','2019-11-29 12:22:28'),(710,'Just Before I Go','On the verge of giving up on life, a guy travels to his hometown to make amends.','tt2980472',2014,'8afe6818c1abb0767c8063bd958f329abc5c105d.jpg','2019-11-29 12:22:28'),(711,'Before We Go','Two strangers stuck in Manhattan for the night grow into each other\'s most trusted confidants when an evening of unexpected adventure forces them to confront their fears and take control of their lives.','tt0443465',2014,'nocover.jpg','2019-11-29 12:22:28'),(712,'Survivor','A Foreign Service Officer in London tries to prevent a terrorist attack set to hit New York City, but is forced to go on the run when she is framed for crimes she did not commit.','tt3247714',2015,'7328ca7124b6aeba31d91e6bb7ba9596df876972.jpg','2019-11-29 12:22:28'),(713,'The Muppets','A Muppet fanatic with some help from his 2 human compatriots must regroup the Muppet gang to stop an avaricious oil mogul from taking down one of their precious life-longing treasures.','tt1204342',2011,'688734dba7f9fc723fdf705efde36745c363c700.jpg','2019-11-29 12:22:28'),(714,'John Carter','Transported to Barsoom, a Civil War vet discovers a barren planet seemingly inhabited by 12-foot tall barbarians. Finding himself prisoner of these creatures, he escapes, only to encounter Woola and a princess in desperate need of a savior.','tt0401729',2012,'80230f97029fde1c8a2dd63f6c9c146ae2e10e9a.jpg','2019-11-29 12:22:29'),(715,'Tracers','Wanted by the Chinese mafia, a New York City bike messenger escapes into the world of parkour after meeting a beautiful stranger.','tt2401097',2015,'c316efb7b317030ffbe803d490f234bbd5ca14ca.jpg','2019-11-29 12:22:29'),(716,'The Best of Me','A pair of former high school sweethearts reunite after many years when they return to visit their small hometown.','tt1972779',2014,'7f9c26265b9519dd2c6efee5fa575f757020c0e2.jpg','2019-11-29 12:22:30'),(717,'The Great Muppet Caper','Kermit the Frog, The Great Gonzo, and Fozzie Bear are reporters who travel to Britain to interview a rich victim of jewel thieves and help her along with her secretary, Miss Piggy.','tt0082474',1981,'616ca357013592d5d7fc71eb9c09cb6d2c754ce2.jpg','2019-11-29 12:22:30'),(718,'Wallace & Gromit: The Curse of the Were-Rabbit','Wallace and his loyal dog, Gromit, set out to discover the mystery behind the garden sabotage that plagues their village and threatens the annual giant vegetable growing contest.','tt0312004',2005,'7488522e11e24f8d265fc3618f5fe5b3103872bc.jpg','2019-11-29 12:22:30'),(719,'Two Night Stand','A snowstorm forces two people who made an online connection to unwillingly extend their one-night stand as the blizzard goes through the night.','tt2140619',2014,'8d909037ba27c59440f70b2578ca99e2cd892946.jpg','2019-11-29 12:22:30'),(720,'Lullaby','A man estranged from his family receives word that his father has chosen to take himself off life support within forty-eight hours.','tt2210781',2014,'fedae894e53b5512625b1a0ad6280cf69da9e3f6.jpg','2019-11-29 12:22:30'),(721,'Frontera','A former Arizona sheriff\'s wife is killed while riding on their ranch property. It would appear a Mexican man illegally crossing into the US is at fault. As the former and the current sheriff search for answers, lives are changed forever.','tt2510028',2014,'bb33afa9c928e0316f7c60d65d7af03b8d1088aa.jpg','2019-11-29 12:22:30'),(722,'The Producers','After putting together another Broadway flop, down-on-his-luck Producer Max Bialystock teams up 